import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div style = {{}}>
        <div style = {{
          textAlign: 'center',
          backgroundColor: 'green',
          height: '100px',
          width: '90%',
          borderRadius: '30px',
          margin: 'auto'
        }}>item1</div>

        <div style = {{
          textAlign: 'center',
          backgroundColor: 'red',
          height: '100px',
          width: '90%',
          borderRadius: '30px',
          margin: 'auto'
        }}>item2</div>

        <div style = {{
          textAlign: 'center',
          backgroundColor: 'pink',
          height: '100px',
          width: '90%',
          borderRadius: '30px',
          margin: 'auto'
        }}>item3</div>

      </div>
    );
  }
}

export default App;
